<p>Project name: –§–æ—Ç–æ–≤–∏—Å—Ç–∞–≤–∫–∞ ¬´–°—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—è –Ω–∞—Ü—ñ—ó. –°—É—á–∞—Å–Ω–∞ —ñ—Å—Ç–æ—Ä—ñ—è¬ª. Project description: –§–æ—Ç–æ–≤–∏—Å—Ç–∞–≤–∫–∞ ¬´–°—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—è –Ω–∞—Ü—ñ—ó. –°—É—á–∞—Å–Ω–∞ —ñ—Å—Ç–æ—Ä—ñ—è¬ª –∑–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞–º–∏ —â–æ—Ä—ñ—á–Ω–æ–≥–æ —Ñ–æ—Ç–æ–∫–æ–Ω–∫—É—Ä—Å—É –≥–∞–∑–µ—Ç–∏ ¬´–î–ï–ù–¨¬ª —Ä–æ–∫—É —Ç–∞ —Å–≤—ñ—Ç–ª–∏–Ω –ø–µ—Ä–µ–º–æ–∂—Ü—ñ–≤ –ø–æ–ø–µ—Ä–µ–¥–Ω—ñ—Ö —Ä–æ–∫—ñ–≤ ‚Äî , —â–æ –≤—ñ–¥–æ–±—Ä–∞–∂–∞—Ç–∏–º—É—Ç—å –∫–ª—é—á–æ–≤—ñ –¥–∞—Ç–∏ —Ç–∞ –ø–æ–¥—ñ—ó –∫—Ä–∞—ó–Ω–∏.</p>
<p>–¢—Ä–∏–≤–∞–ª—ñ—Å—Ç—å –≤–∏—Å—Ç–∞–≤–∫–∏ 14 –¥–Ω—ñ–≤ –£ —Ñ–æ—Ç–æ–∫–æ–Ω–∫—É—Ä—Å—ñ –±–µ—Ä—É—Ç—å —É—á–∞—Å—Ç—å —ñ –ø—Ä–æ—Ñ–µ—Å—ñ–π–Ω—ñ —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏, —ñ –∞–º–∞—Ç–æ—Ä–∏. –í—Ö—ñ–¥ –Ω–∞ –≤–∏—Å—Ç–∞–≤–∫—É –≤—ñ–ª—å–Ω–∏–π. –°—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—è –Ω–∞—Ü—ñ—ó¬ª —Ä–µ–∂. –Ñ–∂–∏ –ì–æ—Ñ–º–∞–Ω —Ä. –ö–æ–∂–Ω–µ —Ñ–æ—Ç–æ –Ω–∞ –≤–∏—Å—Ç–∞–≤—Ü—ñ –º–∞—Ç–∏–º–µ –æ–ø–∏—Å, –Ω–∞–¥—Ä—É–∫–æ–≤–∞–Ω–∏–π —à—Ä–∏—Ñ—Ç–æ–º –ë—Ä–∞–π–ª—è. –¢–∞–∫–æ–∂ –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ –¥—Ä—É–∫ –§–æ—Ç–æ–∞–ª—å–º–∞–Ω–∞—Ö—É ¬´–°—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—è –Ω–∞—Ü—ñ—ó.</p>
